import React, { useState, useEffect } from "react";
import axios from "axios";
import "./App.css";

const PRIORITY_CHOICES = [
  { value: "low", label: "Low" },
  { value: "medium", label: "Medium" },
  { value: "high", label: "High" },
];

const STATUS_CHOICES = [
  { value: "pending", label: "Pending" },
  { value: "in_progress", label: "In Progress" },
  { value: "completed", label: "Completed" },
];

function App() {
  const [chores, setChores] = useState([]);
  const [newChore, setNewChore] = useState({
    title: "",
    description: "",
    due_date: "",
    priority: "",
    status: "",
  });
  const [error, setError] = useState(null);
  const [selectedChore, setSelectedChore] = useState(null);
  const [isEditing, setIsEditing] = useState(false);

  useEffect(() => {
    fetchChores();
  }, []);

  const fetchChores = async () => {
    try {
      const res = await axios.get("http://localhost:8000/api/chores/");
      setChores(res.data);
    } catch (error) {
      console.error(error);
    }
  };

  const createChore = async () => {
    // ... Your create chore logic
  };

  const updateChore = async (id, updatedChore) => {
    try {
      await axios.put(`http://localhost:8000/api/chores/${id}`, updatedChore);
      fetchChores();
      setSelectedChore(null);
      setIsEditing(false);
    } catch (error) {
      console.error(error);
      setError("An error occurred while updating the chore");
    }
  };

  const deleteChore = async (id) => {
    try {
      await axios.delete(`http://localhost:8000/api/chores/${id}`);
      fetchChores();
      setSelectedChore(null);
    } catch (error) {
      console.error(error);
      setError("An error occurred while deleting the chore");
    }
  };

  const editChore = (chore) => {
    setSelectedChore(chore);
    setIsEditing(true);
  };

  return (
    <div>
      <h1>Chores</h1>

      <h2>Create new chore</h2>
      {/* Simple form for creating new chores */}
      <input type="text" value={newChore.title} onChange={e => setNewChore({ ...newChore, title: e.target.value })} />
      <button onClick={createChore}>Create Chore</button>

      <div>
        <h2>Chore List</h2>
        <ul>
          {chores.map((chore) => (
            <li key={chore.id}>
              <strong>{chore.title}</strong>
              <button onClick={() => setSelectedChore(chore)}>View</button>
              <button onClick={() => editChore(chore)}>Edit</button>
              <button onClick={() => deleteChore(chore.id)}>Delete</button>
              {selectedChore?.id === chore.id && (
                <>
                  {isEditing ? (
                    <>
                      <input
                        type="text"
                        value={selectedChore.title}
                        onChange={e => setSelectedChore({ ...selectedChore, title: e.target.value })}
                      />
                      <button onClick={() => updateChore(chore.id, selectedChore)}>Save</button>
                    </>
                  ) : (
                    <>
                      <p>{selectedChore.description}</p>
                      <p>{selectedChore.due_date}</p>
                      <p>{selectedChore.priority}</p>
                      <p>{selectedChore.status}</p>
                      <button onClick={() => setSelectedChore(null)}>Close View</button>
                    </>
                  )}
                </>
              )}
            </li>
          ))}
        </ul>
      </div>
      {error && <p>Error: {error}</p>}
    </div>
  );
}

export default App;
